(139, 1, NULL, '2020-05-02', NULL, 85, 11, 2, 3, '1ºGabriel Alves / 2º Vitor Araújo Gonçalves / 3º Márcio', NULL, '2020-05-06 01:43:56', '2020-05-06 01:43:56', 'Frequentadora Luara.', 'Matheus Furlan\r\nRuddy\r\nThais\r\nAndressa\r\nLuara (Frequentador)\r\nJoão Gabriel (Frequentador)', 'Vitória= esta achando as reuniões de célula muito boa. Ponto negativo: quando a internet não esta muito boa o vídeo trava.\r\n\r\nGregory = Elogiou muito toda organização e material disponivel.\r\n\r\nThais: Funciona muito bem, demonstra \"cuidado\" com cada evento organizado além de nos aproximar mais.\r\n\r\nGuilherme: Informou que não recebe os devocionais pelo Inta (GOSTARIA DE RECEBER), mas que os vês através do linck que o Servo disponibiliza no grupo.\r\n\r\nRuddy: Não se utiliza de redes sociais, sendo assim, assiste somente o culto. Sobre o método de ofertar e dizimar, informa que acharia melhor que cada congregação tivesse a sua conta, porém intende que este foi o método (centavos) que a igreja achou para se organizar. Relata também que devido a Igreja possuir conta em um único banco não é bom, pois devido a isto necessita pagar taxas com TED ou DOC.', NULL),
