(354, 1, NULL, '2020-05-20', NULL, 58, 6, 6, NULL, NULL, NULL, '2020-05-21 00:53:02', '2020-05-21 00:53:02', 'Todos conseguiram assistir e como testemunho o Sr. Silvio tem se dedicado a leitura da palavra e nos surpreendendo com seu entendimento. Glória a Deus. Nas primeiras células o Sr. Amaro não participava mas agora está e bem assíduo.', 'Todos conseguiram assistir. Benção.', 'Ainda continuamos a usar o WhatsApp para a realização da célula, as outras ferramentas ainda não foram testadas mas comentamos em usar. Não foi perguntado sobre as contribuições.', 'O Sr. Silvio necessita de uma cesta Básica todo o mês em função dos seus vencimento serem baixos e ainda pagarem aluguel. O Sr. Amaro e Sr. Amara estão bem sem necessidades imediatas. O Sr. Amaro não está bem de saúde e pedimos oração por eles,'),
